import _ from 'lodash'
import { FETCH_POSTS, GET_POSTS } from '../actions/notes'

export default function (state = [], action) {
  switch (action.type) {
    case FETCH_POSTS:
      const over = action.payload.data
      over.results = _.mapKeys(over.results, 'pk')
      return ([ [over], ...state ])
    case GET_POSTS:
      console.log(action.payload.data)
      return (action.payload.data)
    default:
      return state
  }
}
